import { GET_ERRORS, ERROR_DIPENDENTI } from "../actions/type";

const initialState = {};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_ERRORS:
      return action.payload;
    case ERROR_DIPENDENTI:
      return {
        ...state,
        error: action.error,
      };
    default:
      return state;
  }
}
